// src/pages/CadastrarExame.js

import React, { useState } from 'react';
import { Form, Button } from 'react-bootstrap';

function CadastrarExame() {
    const [nomeExame, setNomeExame] = useState('');
    const [dataRealizacao, setDataRealizacao] = useState('');
    const [resultado, setResultado] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Aqui você pode implementar a lógica para cadastrar o exame
        console.log({ nomeExame, dataRealizacao, resultado });
        // Limpar os campos após o envio
        setNomeExame('');
        setDataRealizacao('');
        setResultado('');
    };

    return (
        <div>
            <h3>Cadastrar Exame</h3>
            <Form onSubmit={handleSubmit}>
                <Form.Group controlId="formNomeExame">
                    <Form.Label>Nome do Exame</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="Digite o nome do exame"
                        value={nomeExame}
                        onChange={(e) => setNomeExame(e.target.value)}
                        required
                    />
                </Form.Group>

                <Form.Group controlId="formDataRealizacao">
                    <Form.Label>Data de Realização</Form.Label>
                    <Form.Control
                        type="date"
                        value={dataRealizacao}
                        onChange={(e) => setDataRealizacao(e.target.value)}
                        required
                    />
                </Form.Group>

                <Form.Group controlId="formResultado">
                    <Form.Label>Resultado</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="Digite o resultado do exame"
                        value={resultado}
                        onChange={(e) => setResultado(e.target.value)}
                        required
                    />
                </Form.Group>

                <Button variant="primary" type="submit">
                    Cadastrar Exame
                </Button>
            </Form>
        </div>
    );
}

export default CadastrarExame;
